const About = () => {
  return (
    <>
      <h1>Hello and welcome to my travel blog!</h1>
      <p>
        Welcome to my blog! I started putting this together in the hopes of motivating myself to add information about my adventures. This includes pictures and perhaps stories...maybe even some recommendations. While I am no expert traveller, I have collected quite a bit of experience through my travel time. Currently I have visited about 15 countries and hope to continue to add to that throughout my life
      </p>
    </>
  );
};

export default About;
